import React from 'react';
import Carousel from './Carousel';

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>Hello</h1>
        <div className="box box-danger">Namaste</div>
        <Carousel />
      </div>
    );
  }
}

export default App;
